import React,{useEffect} from 'react'
import Item from '.'
import './Contextcss.css'
import { useState } from 'react'

const Main = () => {
    const [store, setStore] =useState([]);

    useEffect(()=>{
        
    fetch('https://dummyjson.com/products')
    .then(res => res.json())
    .then(json => setStore(json.products))
            
    },[])
  return (
    <div>
        <div className="wrapper">
        {store.map((ele)=>{
            return (
                <Item src={ele.thumbnail} title={ele.title}/>
            )
        })}
</div>
    </div>
  )
}

export default Main
